const Acceuil = () => {
    let name = "yben alex";
    const handclick = () => {
        name = "alex delors";
        console.log(name);
    }
    const handclick2 = (nom) => {
        console.log(`salut ${nom}`);
    }
    return (
        <div className="home">
            <h2>Notre page d'accueil</h2>
            <br />
            <p>{name}</p>
            <br />
            <button onClick={handclick}>clcquer moi</button>
            <br />
            <br />
            <button onClick={() => handclick2("ybenpro")}>appuyer moi</button>
        </div>
    );
}

export default Acceuil;
